    return (
      <div className="scroll serverlist">
        <div>
            <ul className="server">
                <Server server="@me"></Server>
                <Server server="1"></Server>
                <Server server="2"></Server>
                <AddServer></AddServer>
            </ul>
        </div>
      </div>
      
    );
  }
